        String findGoal(bool weightLoss, bool fatLoss, bool muscleIncrease, bool maintenance)
        {
            if (weightLoss)
            {
                return "Vektnedgang";
            }
            else if (fatLoss)
            {
                return "Fett reduksjon";
            }
            else if (muscleIncrease)
            {
                return "Muskeløkning";
            }
            else
            {
                return "Vedlikehold";
            }
        }

        String findLevel(int n)
        {
            switch (n)
            {
                case 1:
                    return "Nybegynner";
                case 2:
                    return "Erfaren";
                case 3:
                    return "Viderkommende";

            }
            return "Ukjent";
        }
        public String dayToNorwegian(String day)
        {
            switch (day)
            {
                case "monday":
                    return "Mandag";
                case "tuesday":
                    return "Tirsdag";
                case "wednesday":
                    return "Onsdag";
                case "thursday":
                    return "Torsdag";
                case "friday":
                    return "Friday";
                case "saturday":
                    return "Lørdag";
                case "sunday":
                    return "Sunday";
                default:
                    return " ";
            }
        }
    

